  true,\n\t\"url\": null,\n\t\"notes\": \"Small businesses are the core of the U.S.
  economy; and they represent 99 percent of all employer firms. Access to credit is
  key to their survival, growth, and recovery. The banking system continues to be
  their most important supplier of credit.1 This study uses the principal public sources
  of information on U.S. lenders to analyze key lending trends and to evaluate individual
  lendersu2019 emphasis on small business lending.\",\n\t\"license_title\": \"U.S.
